(1,	'Privacy Policy',	'privacy-policy',	'https://staging.aranya.com.bd/privacy-policy',	'<p class=\"ql-align-justify\">Aranyas privacy policy applies to personal information we collect from our customers and job applicants through our website (aranya.com.bd) and at stores across Bangladesh. The policy outlines the information we collect about customers and job applicants; how we use, disclose and otherwise manage this information; and the choices you have to restrict our usage of this information. Ensuring the privacy of your personal information is important to us.</p><p class=\"ql-align-justify\"><strong>When and how information is collected by Aranya</strong></p><p class=\"ql-align-justify\">We collect personal information when you:</p><ul><li class=\"ql-align-justify\">Purchase, order, return or exchange products and services</li><li class=\"ql-align-justify\">Register on our website or My Aranya Rewards programme</li><li class=\"ql-align-justify\">Track your order through Aranya website</li><li class=\"ql-align-justify\">Sign up for Aranya newsletter</li><li class=\"ql-align-justify\">Send or purchase a gift card</li><li class=\"ql-align-justify\">Apply for a job at Aranya through our website or other third party job portals</li><li class=\"ql-align-justify\">Participate in our promotions or surveys</li><li class=\"ql-align-justify\">Contact us with a comment, question or complaint</li></ul><p class=\"ql-align-justify\"><strong>Information collected when you shop at Aranya stores</strong></p><p class=\"ql-align-justify\">You do not have to provide us with any personal information when you make cash purchases at our stores. However, if you use a credit or debit card for your purchases we will collect your card-related information and your signature in order to process your payment. We may also collect your suggestions, complaints or enquiries through emails or complaint/suggestion forms.</p><p class=\"ql-align-justify\"><strong>Information collected by Aranya website</strong></p><p class=\"ql-align-justify\"><strong>My Aranya Rewards programme</strong>&nbsp; We store information of the programmes members, including their purchase order history and history of rewards points collected over a specific period. However, we do not authenticate members personal details and, therefore, cannot be held liable for any misinformation received or fraud or identity theft cases that any member may be charged with.</p><p class=\"ql-align-justify\"><strong>Registered shoppers</strong>&nbsp; We store basic information and purchase history of a registered member in order for members to track their orders.</p><p class=\"ql-align-justify\"><strong>Guest shopper</strong>&nbsp; We may collect personal information, such as name, email address and/or mobile number of a guest shopper who signs up for our newsletter. We use this information to communicate with guest shoppers to provide them with news about special offers.</p><p class=\"ql-align-justify\"><strong>Information collected for orders placed over phone or fax</strong></p><p class=\"ql-align-justify\">No Aranya store or website accepts orders placed over phone or fax. We will never ask for your credit/debit card or any other sensitive information over the phone or email.</p><p class=\"ql-align-justify\"><strong>Information collected when you apply for a job at Aranya</strong></p><p class=\"ql-align-justify\">If you apply for a job through our website, you may be required to provide us with information about yourself that you usually provide on your resume. This information will be saved on our internal server for no more than one year. We use this information to process and respond to your enquiry or job application. We may share your information with the human resources department at Bengal Group Limited in special circumstances. We will not sell your information to any third party or share unless required by the law. We only keep your personal information for as long as necessary for the purposes it was collected, or as otherwise required by the law.</p><p class=\"ql-align-justify\"><strong>Information collected when you sign up for our newsletter</strong></p><p class=\"ql-align-justify\">We will use your email address, if you signed up, to send our electronic newsletters which contain advanced notification of promotions, launch of new merchandise, store openings and other Aranya-related news. We may also use the optional information such as your name, postal code and product interests to enhance our product and services. We respect your privacy and will not sell your email address to any company. You can unsubscribe from our email list at any time by clicking on the unsubscribe link at the bottom of our newsletter.</p><p class=\"ql-align-justify\"><strong>Information collected when you visit or register on Aranya website</strong></p><p class=\"ql-align-justify\">You are not required to register to browse our website. However, you will be required to create an account if you wish to avail special services that registered users can enjoy, by providing us with your email address and a password. Personal information (such as name, address, mobile number, email address, billing address, shipping address and credit card information) you provide to us while creating or updating your account and at checkout on our website is stored in electronic files on our web server and our internal systems in Bangladesh. We use this information to provide and administer the services you have requested and for other purposes to which you have consented.</p><p class=\"ql-align-justify\"><strong>Information collected when you participate in promotional or survey programmes</strong></p><p class=\"ql-align-justify\">When you participate in a promotion or respond to one of our surveys, we may collect your name, address, mobile number and email address. We use this information to administer your participation in the promotion and, for surveys, to contact you with follow-up questions.</p><p class=\"ql-align-justify\"><strong>Information collected by customer service (web interface)</strong></p><p class=\"ql-align-justify\">You may be asked for information that identifies you, such as your name, address and telephone number when you contact our customer service representatives with a question, feedback or comments. We collect this information to verify your identity and to help us promptly answer your question or respond to your comment or feedback. We may retain this information to assist you in the future. We may also use your feedback, suggestions and comments to improve our products, website and services.</p><p class=\"ql-align-justify\"><strong>Information collected through website analytics</strong></p><p class=\"ql-align-justify\"><strong>IP address</strong> You can visit our website without telling us who you are or providing us with any personal information. However, we collect the Internet protocol (IP) addresses of all our website visitors and other related information such as page requests, browser type, operating system and average time spent on our website. We use this information to monitor and improve our website.</p><p class=\"ql-align-justify\"><strong>Cookies</strong> We use cookies and similar technologies to collect product and purchase information from the pages you access or visit. Cookies are bits of information that are automatically stored on your computer so we can recognise you when you return. We use cookies to better understand your use of our website so that we may continue to improve our website. If you do not wish to have cookies on your system, you can set your browser preferences to disable them. However, if you decide not to accept cookies, you may not be able to take advantage of all of the features that our website offers. The information collected through cookies may be combined with other identifiable personal information (such as demographic and past purchase information) from our records and other sources. We may use this combined information for future marketing initiatives and to help us improve our website presentation and your overall shopping experience.</p><p class=\"ql-align-justify\"><strong>Information collected by third party websites and e-advertisements</strong></p><p class=\"ql-align-justify\">Our website may contain links to third party websites. We will not provide any of your personal information to these third parties without your prior consent. We provide these third party links as part of our effort to provide you with news and events information or for your convenience. The inclusion of these links does not imply our endorsement of the companies, their websites, or their products and services. The links of websites we include in our web pages have separate and independent privacy policies. We have no control over these websites and, therefore, have no responsibility or liability for the manner in which the organisations (that operate those linked websites) may collect, use or disclose and otherwise treat your personal details. We may also use third parties to publish our advertisements on other websites, such as electronic newspapers and travel sites. In order to measure the effectiveness of our advertisements, these companies may use tracer tags or web beacons to report certain information (but not your name, address, email address or telephone number) about your visits to Aranya website and the websites which advertise and feature links on Aranya website.</p><p class=\"ql-align-justify\"><strong>Information collected by social media platforms</strong></p><p class=\"ql-align-justify\">You may choose to engage with our content on or through third-party social networking websites, plug-ins and applications. If you choose to do so, you may allow us to have access to certain information associated with your social media account (such as, name, username, email address, profile picture, and gender information) to receive our content or as a requirement of the operation of the website, plug-in or application.</p><p class=\"ql-align-justify\"><strong>Information we share</strong></p><p class=\"ql-align-justify\">We may transfer (or otherwise make available) your personal information to members of Bengal Group and other third parties who provide services on our behalf. We use service providers to process data and online payments, deliver our products and services, host our website, send emails, run our promotions and surveys, to help us better understand your use of our website, and to improve our website. All of our service providers are required to maintain the confidentiality and security of your personal information and to use it only in compliance with applicable privacy laws. These service providers are not authorised to use your information in any manner, other than in helping us to provide you with products and services or as otherwise required by the law.</p><p class=\"ql-align-justify\"><strong>Information collected for legal obligations</strong></p><p class=\"ql-align-justify\">We may be required to provide your personal information in response to a search warrant or other legally valid inquiry or order, or to an investigative body in the case of a breach of an agreement or contravention of law, or as otherwise required by the law in Bangladesh.</p><p class=\"ql-align-justify\"><strong>Security of personal details</strong></p><p class=\"ql-align-justify\">Your privacy is important to us. We ensure practical administrative, technical and physical safeguards in an effort to protect against the loss, theft, unauthorised access, use, modification and disclosure of personal information in our custody and control. Our measures to safeguard personal information in our custody and control include, providing access to personal information only to employees and authorised service providers who require such information for the purposes described in this privacy and security policy. To provide you with an increased level of security, online access to certain personal information may be protected with a password you create. We strongly recommend that you do not disclose your password to anyone. We will never ask you for your password in any unsolicited communication.</p><p class=\"ql-align-justify\"><strong>Policy changes</strong></p><p class=\"ql-align-justify\">We may periodically update this privacy policy for new, unanticipated uses not previously disclosed. Any changes made to the policy will be posted here.</p><p class=\"ql-align-justify\"><strong>Updating your profile</strong></p><p class=\"ql-align-justify\">If you wish to access or update your profile details that we have about you, or to correct factual errors in our records, please&nbsp;<a href=\"https://aranya.com.bd/contact-us/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(59, 84, 115);\">contact us</a>. To protect your privacy, we will take necessary steps to verify your identity before granting access or making corrections. You can also easily update your account information by logging on to your Aranya account.</p><p><br></p>',	1,	'2023-07-24 05:52:24',	NULL),
(2,	'Terms And Conditions',	'terms-and-conditions',	'https://staging.aranya.com.bd/terms-and-conditions',	'<p class=\"ql-align-justify\"><strong>Terms and Conditions</strong></p><p class=\"ql-align-justify\">Welcome to Aranya Crafts Limited also hereby known as we, us or Aranya. We are sister company of Bengal Foundation and Aranya and its sub-brand Aatong are represented at this virtual shop. The following are the basic rules that govern your use of our site. Your use of Aranya site constitutes your agreement to follow and be bound by these terms. If you do not agree to these terms, please do not use this site.</p><p class=\"ql-align-justify\"><strong>Terms and Conditions may change</strong></p><p class=\"ql-align-justify\">Since Aranya may revise this agreement at any time, you should visit this page periodically to review the terms of your use. Should you have any questions concerning any of our policies, please&nbsp;<a href=\"https://aranya.com.bd/contact-us/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(59, 84, 115);\">contact us</a>.</p><p class=\"ql-align-justify\"><strong>Availability</strong></p><p class=\"ql-align-justify\">Please understand that our featured items offered are naturally dyed and therefore in limited quantities and, because of their limited availability and nature of production, stock will not and cannot be refreshed. That means once an item is gone, it may be gone for good and not appear on the website again. When an item featured on aranya.com.bd is no longer in stock, we make every attempt to remove that item from the website in a timely manner. Should you have any questions concerning the availability of a particular item, please contact us at +88 02 9882542 between 9am and 5pm Bangladesh time or go to&nbsp;<a href=\"https://aranya.com.bd/contact-us/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(59, 84, 115);\">contact us</a>.</p><p class=\"ql-align-justify\"><strong>Product Information</strong></p><p class=\"ql-align-justify\">Please note that considering the laws of Bangladesh on shippable items, fragility and other constraints, Aranya does not carry every item that you would find in our stores. The prices displayed on the website are quoted in Bangladeshi Taka (BDT). Most Aranya products displayed on the website are available in select Aranya stores in Bangladesh while supplies last. In some cases, web merchandise may not be available in Bangladesh stores. Stores may also have different prices or promotional events at different times. Sale prices on the website are Internet-only specials, and do not reflect the pricing of Bangladesh stores.</p><p class=\"ql-align-justify\"><strong>Natural Dye</strong>&nbsp; Aranya products are dyed naturally therefore we cannot guarantee that the product you see online and the purchased product will be exactly the same though every effort is made for it to be a very close match.</p><p class=\"ql-align-justify\"><strong>Colours</strong>&nbsp; We have made every effort to display as accurately as possible the colours of our products that appear on the website. However, due to monitor discrepancies of personal computer/laptop/tablet/hand-held devices/mobile, we cannot guarantee that your display of colour will be accurate.</p><p class=\"ql-align-justify\"><strong>Pricing</strong>&nbsp; In the event an Aranya product is listed at an incorrect price due to photographical or typographical error or error in pricing information, Aranya shall have the right to refuse or cancel any orders placed for product listed at the incorrect price.</p><p class=\"ql-align-justify\"><strong>Payment and Credit Note</strong>&nbsp; Aranya shall have the right to refuse or cancel any such orders whether or not the order has been confirmed and your credit card charged. If your credit card has already been charged for the purchase and your order is cancelled Aranya shall issue a credit note in the amount of the incorrect price. Aranya does not provide refunds for online orders, including cost of shipping and handling.</p><p class=\"ql-align-justify\"><strong>Shipping and Processing Fees</strong>&nbsp; Our shipping and processing charges are intended to compensate designated shipping companies in addition to covering the cost of processing your order, handling and packing the purchased products and delivering them to you. The risk of loss and title for items deliverable to you pass to you upon our delivery to the carrier.</p><p class=\"ql-align-justify\"><strong>Inaccuracy Disclaimer</strong></p><p class=\"ql-align-justify\">From time to time there may be information on our website or in our newsletter that contains typographical errors, inaccuracies, or omissions that may relate to product descriptions, pricing, and availability. Aranya reserves the right to correct any errors, inaccuracies or omissions and to change or update information at any time without prior notice (including after you have submitted your order). We endeavour to present the most recent, most accurate, and most reliable information on our website at all times. However, there may be occasions when some of the information featured on aranya.com.bd may contain incomplete data, typographical errors, or inaccuracies. Any errors are wholly unintentional and we apologise if erroneous information is reflected in merchandise price, item availability, or in any way affects your individual order. Please be aware that we present our content as is and make no claims to its accuracy, either expressed or implied. We reserve the right to amend errors or to update product information at any time without prior notice.</p><p class=\"ql-align-justify\"><strong>Legal Information</strong></p><p class=\"ql-align-justify\">This website is expressly owned and operated by Aranya. Unless otherwise noted, all design and content featured on aranya.com.bd, including navigational buttons and images, logos, artwork, icons, graphics, photography, text, and the like, are copyrights, trademarks, trade dress, and/or intellectual property that are owned, controlled, or licensed by Aranya. This website in its entirety is protected by copyright and applicable trade dress and are protected under Bangladeshi and international copyright laws. All worldwide rights, titles, and interests are reserved. The contents of our website and the website as a whole are intended solely for your personal, non-commercial use. Any use of our website and its content for purposes other than personal and non-commercial, is prohibited without the prior written permission of Aranya. Do not reproduce, publish, display, modify, sell, or distribute any of the materials from Aranya. You may, however, download or electronically copy and print any of the page contents displayed on the site, but please remember that these are available for your personal, non-commercial use only. Should you choose to download, copy, or forward any site materials via email, no right, title, or interest in those materials will be transferred to you.</p><p class=\"ql-align-justify\"><strong>Any dispute or claim  related to your use of aranya.com.bd in any way, or to any product or service distributed by Aranya  will be subject to the laws of Bangladesh and will be resolved by binding arbitration under the Arbitration Act of 2001 of Bangladesh. If necessary the dispute may be submitted to court in the jurisdiction of Bangladesh.</strong></p><p class=\"ql-align-justify\"><strong>Limitation of Liability</strong>&nbsp; Given the unpredictability of technology, internet connectivity and the online environment, Aranya does not warrant that the function or operation of this website will be uninterrupted or error-free, that defects will be corrected, or that this site or the server that makes it available will be free of viruses or other harmful elements. As a visitor to and user of this website, you must assume full responsibility for any costs associated with the servicing of equipment used in connection with the use of our website. As a visitor to and a user of this website, you, in effect, agree that your access will be subject to the terms and conditions set forth in this legal notice and that access is undertaken at your own risk. Aranya shall not be liable for damages of any kind related to your use of or inability to access this website. Aranya will not be responsible for any fraud, theft or mistake in the usage of your creditcard in the online purchase of any Aranya item.</p><p class=\"ql-align-justify\"><strong>Indemnification</strong>&nbsp; You agree to indemnify, defend, and hold harmless Aranya, its officers, directors, employees, agents, licensors and suppliers (collectively the Service Providers) from and against all losses, expenses, damages and costs, including reasonable attorneys fees, resulting from any violation of these terms and conditions or any activity related to your account (including negligent or wrongful conduct) by you or any other person accessing the site using your Internet account.</p><p class=\"ql-align-justify\"><strong>Correspondence and Communications</strong></p><p class=\"ql-align-justify\">Although we will make every effort to respond quickly to applicable email messages, aranya.com.bd is under no obligation to respond to all pieces of correspondence received through this site, or to maintain your submitted comments in confidence, or to pay compensation of any kind for your comments or submissions.</p><p class=\"ql-align-justify\">While we welcome your comments and feedback regarding aranya.com.bd, our merchandise and our services, we do not wish to receive any confidential or proprietary ideas, suggestions, materials, or information via this website or any email connection. All your comments, feedback, ideas, suggestions, and other submissions that are disclosed or submitted to our organization through aranya.com.bd shall become and remain the property of Aranya. Any such disclosure or submission by you is a declaration of the full release of all proprietary claims and/or intellectual rights regarding your submission. However, we will not use your name in connection with any such materials, information, suggestions, ideas or comments unless we first obtain your permission or otherwise are required by law to do so.</p><p><br></p>',	1,	'2023-07-24 05:53:09',	NULL);
