(1,	'Pansy Cotton Voil Panjabi',	'pansy-cotton-voil-panjabi',	3,	0,	1,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010352FFS1202719/4_1.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010352FFS1202719/4_1.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010352FFS1202719/4_2.png',	'',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'K0010352FFS1202719',	NULL,	NULL,	NULL,	'The mesmerizing shades of red complimenting in this panjabi were taken from organically grown madder successively. Block print has been used on cotton voil fabric to ensure the highest amount of easement. All Aranya products are hand made, using natural fibers and materials within a fair trade framework.',	1,	0,	1,	'2023-03-22 03:14:41',	NULL,	'2023-03-22 03:14:41'),
(2,	'Deutzia baby panjabi ',	'deutzia-baby-panjabi',	3,	0,	1,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010372NK10194019/5_1.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010372NK10194019/5_1.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010372NK10194019/5_2.png',	'',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'K0010372NK10194019',	NULL,	NULL,	NULL,	'Dark designs on a light base and comfortable fabric makes it a perfect traditional wear for your child.All Aranya products are handmade, using natural materials, within a fair trade framework.',	1,	0,	1,	'2023-03-22 03:14:42',	NULL,	'2023-03-22 03:14:42'),
(3,	'Chiliad Kids Panjabi ',	'chiliad-kids-panjabi',	3,	0,	1,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010373NK10194019/6_1.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010373NK10194019/6_1.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010373NK10194019/6_2.png',	'',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'K0010373NK10194019',	NULL,	NULL,	NULL,	'Pomegranate and myrobalan have been used to bring out the olive color on this wax-printed cotton kids panjabi. All Aranya products are handmade, using natural materials, within a fair trade framework.',	1,	0,	1,	'2023-03-22 03:14:42',	NULL,	'2023-03-22 03:14:42'),
(4,	'Cistus Kids Panjabi ',	'cistus-kids-panjabi',	3,	0,	1,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010374NK10194019/7_1.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010374NK10194019/7_1.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010374NK10194019/7_2.png',	'',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'K0010374NK10194019',	NULL,	NULL,	NULL,	'Wax-printed pure cotton kids Panjabi that has been dipped in betelnut to extract the pink shade. All Aranya products are handmade, using natural materials, within a fair trade framework.',	1,	0,	1,	'2023-03-22 03:14:42',	NULL,	'2023-03-22 03:14:42'),
(5,	'Oboni Cotton Panjabi ',	'oboni-cotton-panjabi',	3,	0,	1,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010379NHS1204219/8_1.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010379NHS1204219/8_1.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010379NHS1204219/8_2.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya-product-v2/K0010379NHS1204219/8_2.png',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'K0010379NHS1204219',	NULL,	NULL,	NULL,	'The shiny blue in this Panjabi is taken from an enticing by indigo. Traditional tie-dyeing technique has been used on cotton and black kashmi print to create detailed intricacies. All Aranya products are hand made, using natural fibers and materials within a fair trade framework.',	1,	0,	1,	'2023-03-22 03:14:42',	NULL,	'2023-03-22 03:14:42'),
