(126,	'Macbook Pro',	'macbook-pro',	6,	28,	2,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/v1683708568/aranya/338334282_1308641929686659_5561078571324706171_n.jpg',	'https://res.cloudinary.com/diyc1dizi/image/upload/v1683708568/aranya/338334282_1308641929686659_5561078571324706171_n.jpg',	NULL,	NULL,	NULL,	NULL,	'19',	'14',	'13',	'cm',	'Bangladeshi',	'500 gm',	'CS234354DW5',	'Off-White,White',	NULL,	NULL,	'<p><span style=\"color: rgb(5, 5, 5);\">My father told me that it was better to learn to control the ball barefoot in order to have sensitivity in my feet, and I promised him that I would control that ball like no other, but what really happened was that he didn\'t have the money to buy me a pair of shoes. When I won my first Ballon d\'Or, I didn\'t cry for joy, I cried because I didn\'t have my father alive.</span></p>',	1,	0,	0,	'2023-05-10 03:09:37',	'2023-05-22 12:31:23',	'2023-05-22 12:31:23'),
