(128,	'Botev Eri Silk Panjabi',	'botev-eri-silk-panjabi',	2,	13,	1,	NULL,	'v1685421664/aranya/H2105_1.webp',	'v1685421664/aranya/H2105_1.webp',	'v1685420841/aranya/181.png',	'v1685420905/aranya/182.png',	'v1685420969/aranya/183.png',	NULL,	'30',	'2',	'27',	'pcs',	NULL,	'.200',	'M0010307MA08181019',	'Red,White,Black',	NULL,	NULL,	'<p><span style=\"color: rgb(0, 0, 0);\">Block printed design has been outlined on this Eri silk Panjabi, while naturally dyeing with Annato which flourished it\'s Red colours and kashmi for the black.</span></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">All Aranya products are handmade, using natural materials, within a fair trade framework.</span></p>',	1,	0,	1,	'2023-05-30 03:58:01',	'2023-05-30 04:43:18',	'2023-05-30 04:43:18'),
(129,	'Spongebob baby kantha',	'spongebob-baby-kantha',	4,	19,	1,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/v1685422477/aranya/277.webp',	'https://res.cloudinary.com/diyc1dizi/image/upload/v1685422477/aranya/277.webp',	'https://res.cloudinary.com/diyc1dizi/image/upload/v1685422486/aranya/248.webp',	NULL,	NULL,	NULL,	'25',	'20',	'4',	'pcs',	NULL,	'.185',	'K03100015RG02190919',	'',	NULL,	NULL,	'<p>The opposing tones of this piece stunningly complient each other, making it very eye catching.</p><p>All Aranya products are handmade, using natural materials, within a fair trade framework.</p>',	0,	0,	0,	'2023-05-30 04:55:12',	'2023-08-10 03:14:24',	'2023-08-10 03:14:24'),
(130,	'test product',	'test-product',	6,	35,	1,	NULL,	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya/4_2.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya/4_2.png',	'https://res.cloudinary.com/diyc1dizi/image/upload/aranya/11_1.png',	NULL,	NULL,	NULL,	'244',	'265',	'655',	'cm',	NULL,	'0.4 kg',	'DFEREFFDFF',	'White,Off-White',	'No',	NULL,	'<p><span style=\"color: rgb(63, 64, 65);\">The India international put on a batting masterclass blasting 11 sixes and 28 fours. Along the way he eclipsed his undefeated 227 for Mumbai against Puducherry at Jaipur in 2021. He also moved past Ben Duckett\'s 220 not out for England Lions against Sri Lanka A in 2016 to post the second-highest ever List A innings made in England. Only Alistair Brown with 268 for Surrey against Glamorgan at the Oval in 2002 has scored more.</span></p>',	1,	0,	1,	'2023-08-10 05:49:37',	'2023-08-13 05:29:12',	'2023-08-13 05:29:12'),
